/* -- INTERNAL FUNCTIONS                                                         -- */
/* -------------------------------------------------------------------------------- */
void _UG_PutChar( char chr, UG_U16 x, UG_U16 y, UG_COLOR fc, UG_COLOR bc, const UG_FONT* font)
{
   UG_U16 i,j,k,xo,yo,c,bn,actual_char_width;
   UG_U8 b,bt;
   UG_U32 index;
   bt = (UG_U8)chr;

   switch ( bt )
   {
      case 0xF6: bt = 0x94; break; // �
      case 0xD6: bt = 0x99; break; // �
      case 0xFC: bt = 0x81; break; // �
      case 0xDC: bt = 0x9A; break; // �
      case 0xE4: bt = 0x84; break; // �
      case 0xC4: bt = 0x8E; break; // �
      case 0xB5: bt = 0xE6; break; // �
      case 0xB0: bt = 0xF8; break; // �
   }

   if (bt < font->start_char || bt > font->end_char) return;
   
   yo = y;
   bn = font->char_width;
   if ( !bn ) return;
   bn >>= 3;
   if ( font->char_width % 8 ) bn++;
   actual_char_width = (font->widths ? font->widths[bt - font->start_char] : font->char_width);

 /*Not accelerated output*/
   if (font->font_type == FONT_TYPE_1BPP){
	 index = (bt - font->start_char)* font->char_height * bn;
	 for( j=0;j<font->char_height;j++ )
	 {
	   xo = x;
	   c=actual_char_width;
	   for( i=0;i<bn;i++ )
	   {
		 b = font->p[index++];
		 for( k=0;(k<8) && c;k++ )
		 {
		   if( b & 0x01 )
		   {
			  gui->pset(xo,yo,fc);
		   }
		   else
		   {
			  gui->pset(xo,yo,bc);
		   }
		   b >>= 1;
		   xo++;
		   c--;
		 }
	   }
	   yo++;
	 }
   }
}

void _UG_PutText(UG_TEXT* txt)
{
   UG_U16 sl,rc,wl;
   UG_U16 xp,yp;
   UG_U16 xs=txt->a.xs;
   UG_U16 ys=txt->a.ys;
   UG_U16 xe=txt->a.xe;
   UG_U16 ye=txt->a.ye;
   UG_U8  align=txt->align;
   UG_U16 char_width=txt->font->char_width;
   UG_U16 char_height=txt->font->char_height;
   UG_U16 char_h_space=txt->h_space;
   UG_U16 char_v_space=txt->v_space;

   char chr;

   char* str = txt->str;
   char* c = str;

   if ( txt->font->p == NULL ) return;
   if ( str == NULL ) return;
   if ( (ye - ys) < txt->font->char_height ) return;

   rc=1;
   c=str;
   while ( *c != 0 )
   {
      if ( *c == '\n' ) rc++;
      c++;
   }

   yp = 0;
   if ( align & (ALIGN_V_CENTER | ALIGN_V_BOTTOM) )
   {
      yp = ye - ys + 1;
      yp -= char_height*rc;
      yp -= char_v_space*(rc-1);
      if ( yp < 0 ) return;
   }
   if ( align & ALIGN_V_CENTER ) yp >>= 1;
   yp += ys;

   while( 1 )
   {
      sl=0;
      c=str;
      wl = 0;
      while( (*c != 0) && (*c != '\n') )
      {
         if (*c < txt->font->start_char || *c > txt->font->end_char) {c++; continue;}
         sl++;
         wl += (txt->font->widths ? txt->font->widths[*c - txt->font->start_char] : char_width) + char_h_space;
         c++;
      }
      wl -= char_h_space;

      xp = xe - xs + 1;
      xp -= wl;
      if ( xp < 0 ) return;

      if ( align & ALIGN_H_LEFT ) xp = 0;
      else if ( align & ALIGN_H_CENTER ) xp >>= 1;
      xp += xs;

      while( (*str != '\n') )
      {
         chr = *str++;
         if ( chr == 0 ) return;
         _UG_PutChar(chr,xp,yp,txt->fc,txt->bc,txt->font);
         xp += (txt->font->widths ? txt->font->widths[chr - txt->font->start_char] : char_width) + char_h_space;
      }
      str++;
      yp += char_height + char_v_space;
   }
}


void UG_DrawBMP_MONO( UG_U8 xp, UG_U8 yp, UG_BMP_MONO* bmp ){
	UG_U8 xx,yy,b;
	UG_U8 x,y;

	if ( bmp->p == NULL ) return;
	for(y=0;y<bmp->height;y++){
	  for(x=0;x<bmp->width;x++){
		 yy = y / 8 ;
		 xx = y % 8;
		 b = bmp->p[x + yy * bmp->width];
		 xx = 1 << xx;
		 xx = xx & b;
		 if(xx){ UG_DrawPixel( x + xp , y + yp , C_WHITE ); }
		 else{ UG_DrawPixel( x + xp , y + yp , C_BLACK ); }
	  }
	}
}

